import React from 'react';

export class Login extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            username: "name",
        }

        this.handleUsername.bind(this);
    }

    handleUsername(name){
        this.setState({
            username: name
        });
    }


    render() {
        return (
            <div>
                <form>
                    <label>
                        Username:
                        <input type="text" onChange={() => this.handleUsername(this.state.username)}/>
                    </label>
                </form>
                <p>{this.state.username}</p>
            </div>
        )
    }
}
